package com.tsatsatzu.subwar.game.data;public class SWContextBean{    private String  mLastOperationMessage;    private String  mLastOperationError;    private SWUserBean mUser;    private SWGameDetailsBean mGame;    public String getLastOperationMessage()    {        return mLastOperationMessage;    }    public void setLastOperationMessage(String lastOperationMessage)    {        mLastOperationMessage = lastOperationMessage;    }    public String getLastOperationError()    {        return mLastOperationError;    }    public void setLastOperationError(String lastOperationError)    {        mLastOperationError = lastOperationError;    }    public SWUserBean getUser()    {        return mUser;    }    public void setUser(SWUserBean user)    {        mUser = user;    }    public SWGameDetailsBean getGame()    {        return mGame;    }    public void setGame(SWGameDetailsBean game)    {        mGame = game;    }}